<html><head><meta http-equiv="Content-Type" content="text/html; charset=UTF-8"></head><body><b>无法解析的 IP</b><p>“无法解析的 IP”报告列有所使用的 IP 地址不具有地理位置或域主机之类所有权数据的所有访问者。 “无法解析的 IP”报告所包含的 IP 地址无法在相关 Urchin 地理位置或域报告中得到跟踪。<p><p><%dic|default|505%><p>要比较两个时间范围，请点击蓝色“报告查看时间范围”标题栏上的 <img alt="Date Range Comparison" title="Date Range Comparison" src="/uicons/report/ccals.gif" border="0"> 图标。</body></html>
